const helper = {
	createId: () => {
		const s4 = () => (((1 + Math.random()) * 0x10000)|0).toString(16).substring(1);
		return s4() + s4() + "-" + s4() + s4() + s4() + s4();
	},
	createEmptyDataRoom: () => {
		const data = {
			room: {
				id: "",
				name: ""
			},
			loggedUser: {
				userId: "",
				isAdmin: false,
				username: "",
				email: ""
			},
			questions: []
		};

		return data;
	},
	createDataRoom: params => {
		const data = helper.createEmptyDataRoom();
		data.room.id = helper.createId();
		data.room.name = params.roomName;
		data.loggedUser.userId = params.userId;
		data.loggedUser.isAdmin = true;
		data.loggedUser.username = params.username;
		data.loggedUser.email = params.email;
		
		return data;
	},
	createQuestionsItem: (username, userId, content) => {
		return {
			username: username,
			userId: userId,
			content: content,
			isHandsUp: false,
			time: Date.now()
		};
	}
};

export default helper;
